import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 9.1-913 Public dissemination by means of the Internet.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/9.1-913.md","filePath":"vacode/9.1-913.md"}'),n={name:"vacode/9.1-913.md"},r=a('<h1 id="§-9-1-913-public-dissemination-by-means-of-the-internet" tabindex="-1">§ 9.1-913 Public dissemination by means of the Internet. <a class="header-anchor" href="#§-9-1-913-public-dissemination-by-means-of-the-internet" aria-label="Permalink to &quot;§ 9.1-913 Public dissemination by means of the Internet.&quot;">​</a></h1><p>The State Police shall develop and maintain a system for making certain Registry information on persons convicted of an offense for which registration is required publicly available by means of the Internet. The information to be made available shall include the offender&#39;s name; all aliases that he has used or under which he may have been known; the date and locality of the conviction and a brief description of the offense; his age, current address, and photograph; his current work address; the name of any institution of higher education at which he is currently enrolled; and such other information as the State Police may from time to time determine is necessary to preserve public safety, including but not limited to the fact that an individual is wanted for failing to register, reregister, or verify his registration information. The system shall be secure and not capable of being altered except by the State Police. The system shall be updated each business day with newly received registrations, reregistrations and verifications of registration information. The State Police shall remove all information that it knows to be inaccurate from the Internet system.</p><p>2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0584" target="_blank" rel="noreferrer">584</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0603" target="_blank" rel="noreferrer">603</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0914" target="_blank" rel="noreferrer">914</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0335" target="_blank" rel="noreferrer">335</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0829" target="_blank" rel="noreferrer">829</a>.</p>',3),o=[r];function s(l,c,h,f,d,g){return t(),i("div",null,o)}const p=e(n,[["render",s]]);export{b as __pageData,p as default};
